// src/Welcome.js
import React from 'react';

const Welcome = ({ onNext }) => {
    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh' }}>
            <h1>Welcome</h1>
            <h2>You are going to evaluating the data visualization between the static map and the interactive map.
                <br>
                </br>The static maps were made by QGIS and the interactive map was made by d3.React </h2>
            <button onClick={onNext} style={{ padding: '10px 20px', fontSize: '16px', marginTop: '20px' }}>
                Next
            </button>
        </div>
    );
};

export default Welcome;
